        /// <summary>
        /// Gets the number of a map sheet
        /// </summary>
        /// <param name="point">Input point</param>
        /// <returns>Number of map sheet that the input point is located</returns>
        public static string GetUTMListNumber(GeoPoint point)
        {
            try
            {
                foreach (KeyValuePair<string, string> kv in dicMapList)
                {
                    string[] wtf = kv.Value.Split(' ');

                    if ((point.X <= double.Parse(wtf[0])) && (point.X >= double.Parse(wtf[4])) && (point.Y >= double.Parse(wtf[1])) && (point.Y <= double.Parse(wtf[5])))
                    {
                        return kv.Key;
                    }
                }

                return null;
            }
            catch (Exception ex) { throw new Exception("UTM List not found", ex); }
        }
